import { useState } from 'react'
import './SearchStyles/SearchBar.scss'
function SearchBar(props){
    const [searchByName, setSearchByName] = useState('')
    const [minPriceValue, setminPriceValue] = useState('')
    const [maxPriceValue, setmaxPriceValue] = useState('')
    props.CoinsData(searchByName, minPriceValue, maxPriceValue)
    return(
        <div className="searchBar">
        <input type="search" name="name" placeholder='Search by coin' onChange={event =>{setSearchByName(event.target.value)}}/>
        <input type="number" name="name" placeholder='Price from' onChange={event =>{setminPriceValue(event.target.value)}}/>
        <input type="number" name="name" placeholder='Price to' onChange={event =>{setmaxPriceValue(event.target.value)}}/>
        </div>
    )
}

export default SearchBar
